import React from "react";
import '../App.css';

export default function IncrementButton({type, changeHandler}){
    if(type === "increment"){
        return (
            <div onClick={changeHandler}>
                <i class="fa-solid fa-arrow-up"></i>
            </div>
        )
    }
    else if(type === "decrement"){
        return (
            <div onClick={changeHandler}>
                <i class="fa-solid fa-arrow-down"></i>
            </div>
        )
    }
}
